import React from "react";
import "./Picupload.css";



const Picupload = () => {
    return (
      <div>
        <div className = "f_container">
            <div className = "img">1</div>
            <div>
            <input type="text" placeholder = "제목" id="uploadtitle" name="uploadtitle" /><br/>
                <textarea
                    type = "text"
                    placeholder= "설명"
                    cols = "40"
                    rows = "2"
                    id = "uploadcomment"
                />
                <br/>
                <input type="text" placeholder = "재료" id="uploadmaterial" name="uploadmaterial" /><br/>
            </div>
        </div>
      </div>
    );
  };
  
  export default Picupload;
